const Home = () => {
  const handleClick = (e) => {
    console.log("Hello world!",e);
  };
  const handleClickAgain = (name,) => {
    console.log("Hello " + name);
  };
  return (
    <div className="Home">
      <h2>Homepage</h2>
      <button onClick={handleClick}>Click me!</button>
      <button
        onClick={(e) => {
          handleClickAgain("Nikita",e);
        }}
      >
        Click me again!
      </button>
    </div>
  );
};

export default Home;
